On m'a déjà posé la question "il faut quoi comme matériel pour commencer le tir longue distance ?", alors voilà la liste du débutant :

- Une carabine ;
- Une lunette ;
- Des munitions ;
- Un carnet pour prendre des notes ;
- Soi-même.

Voilà, c'est à peu près tout.

Je ne rigole même pas.
1/12
